INSERT INTO `news` (`newsid`, `newstitle`, `newsresume`, `newscontent`, `newscategory`, `newstype`, `newsfront`, `newsthumb`, `newsdate`, `newsslug`, `newsdraft`, `newsscheduled`, `newsstatus`) VALUES
(2, 'Brasileiro projetado para ter início em 8 e 9 de agosto', 'Em reunião da Comissão Nacional de Clubes. Todos os clubes concordaram', '<p>A dire&ccedil;&atilde;o da CBF e os dirigentes de clubes das s&eacute;ries A e B projetaram, em reuni&atilde;o nesta quinta-feira(25), o in&iacute;cio do Campeonato Brasileiro para o&nbsp;<strong>fim de semana de 8 e 9 de agosto. Com 38 rodadas mantidas, a edi&ccedil;&atilde;o do Brasileiro 2020 s&oacute; vai terminar em fevereiro</strong>.</p>\r\n\r\n<p>A informa&ccedil;&atilde;o da data estipulada para o in&iacute;cio da competi&ccedil;&atilde;o foi publicada primeiramente pelo portal &quot;Uol&quot;. Os clubes decidiram ainda que a Copa do Brasil tamb&eacute;m retorna a partir do fim da segunda semana de agosto.</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/Cópia de CORPO.png\" style=\"height:420px; width:740px\" /></p>\r\n\r\n<p><strong>&Agrave;s 20h53, a CBF soltou a seguinte nota:</strong></p>\r\n\r\n<blockquote>\r\n<p><em>&quot;O campeonato Brasileiro da S&eacute;rie A poder&aacute; retornar no dia 9 de agosto, domingo. A S&eacute;rie B tem data prevista de recome&ccedil;o para 8 de agosto.</em></p>\r\n\r\n<p><em>A decis&atilde;o foi tomada na noite desta quinta-feira, em reuni&atilde;o convocada pela CBF junto com a Comiss&atilde;o Nacional de Clubes (CNC) com a participa&ccedil;&atilde;o dos 40 clubes disputantes duas s&eacute;ries.</em></p>\r\n\r\n<p><em>As datas b&aacute;sicas e o cronograma de retorno foram propostos pelo presidente da CBF, Rog&eacute;rio Caboclo, e apoiadas pelos clubes.</em></p>\r\n\r\n<p><em>O retorno do futebol depende da autoriza&ccedil;&atilde;o das autoridades de sa&uacute;de. Mas, dezenove dos vinte clubes da S&eacute;rie A se dispuseram a jogar fora das suas cidades, em &uacute;ltima inst&acirc;ncia, caso at&eacute; l&aacute; seus munic&iacute;pios n&atilde;o estejam liberados pelas autoridades de sa&uacute;de a realizar jogos. Foi um sinal de apoio &agrave; realiza&ccedil;&atilde;o da competi&ccedil;&atilde;o pela CBF.&quot;</em></p>\r\n</blockquote>\r\n\r\n<p>A CBF vai&nbsp;<strong>marcar as 38 rodadas do Brasileiro e tamb&eacute;m as partidas da Copa do Brasil - ser&atilde;o dois jogos por semana</strong>, exce&ccedil;&atilde;o ao espa&ccedil;o das datas Fifas, previstas para voltarem em setembro.</p>\r\n\r\n<p>Os clubes deliberaram ainda sobre o mando de campo. Como nem todos clubes podem conseguir autoriza&ccedil;&atilde;o de prefeitura para liberar partidas, foi discutida&nbsp;<strong>a transfer&ecirc;ncia de jogos para outras cidades, que tenham libera&ccedil;&atilde;o de realizarem eventos esportivos</strong>. Os jogos est&atilde;o previstos sem p&uacute;blico. Neste item,&nbsp;<strong>apenas o Athletico-PR votou contra</strong>. O clube paranaense est&aacute; momentaneamente proibido de treinar na capital do estado.</p>\r\n\r\n<h2>Nova janela de transfer&ecirc;ncias</h2>\r\n\r\n<p>Nessa quarta-feira, os clubes e a CBF&nbsp;j&aacute; haviam definido o adiamento da janela de transfer&ecirc;ncias. A primeira janela tinha previs&atilde;o de abertura para o pr&oacute;ximo dia 1&ordm; de julho (quarta-feira da outra semana), mas ser&aacute; adiada para o fim de julho e deve terminar no fim de agosto. A segunda janela deve ficar para meados de setembro e outubro. As datas exatas ainda ser&atilde;o definidas pela CBF.</p>\r\n\r\n<p>A defini&ccedil;&atilde;o de in&iacute;cio de Brasileiro provavelmente vai pegar ainda estaduais em curso. Al&eacute;m das competi&ccedil;&otilde;es regionais, ainda h&aacute; Libertadores e Sul-Americana para encaixar neste calend&aacute;rio.</p>\r\n', 6, 1, '5bd1e870d7b7fdebc4679bd0d5b54858.png', 'abbc0f3961d79cdf13cc5267b4540744.png', '2020-06-28 03:00:00', 'brasileiro-projetado-para-ter-inicio-em-8-e-9-de-agosto', 0, 0, 0),
(3, 'Inscrições abertas para o Bolão Acretinos', 'O Bolão Acretinos voltou e com novidades. As inscrições já estão abertas e serão realizadas diretamente pelo site da Liga Acretinos.', '<h3>Bol&atilde;o Acretinos</h3>\r\n\r\n<p>A competi&ccedil;&atilde;o mais aguardada pelos participantes da Liga Acretinos est&aacute; de volta&nbsp;para a temporada 2020. No formato tiro curto, o Bol&atilde;o Acretinos tem e tornado uma das competi&ccedil;&otilde;es preferidas pelos cartoleiros da Liga Acretinos, com disputas que se arrastam at&eacute; o ultimo toque na bola (ou at&eacute; o mercado abrir).</p>\r\n\r\n<p>Na temporada de 2020 o Bol&atilde;o Acretinos vem com uma grande novidade: as inscri&ccedil;&otilde;es ser&atilde;o realizadas&nbsp;<strong>exclusivamente</strong>&nbsp;pelo site da liga!</p>\r\n\r\n<p>Desenvolvemos um sistema, apelidado de <a href=\"https://portal.acretinos.com.br\">Portal</a>, para servir de meio para os cartoleiros realizarem suas inscri&ccedil;&otilde;es nas rodadas do Bol&atilde;o Acretinos.</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/bolaoretornobody1.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>O Portal ficou bastante intuitivo e simples de se usar, mas de toda forma, segue um passo a passo em texto de como realizar sua inscri&ccedil;&atilde;o:</p>\r\n\r\n<ol>\r\n	<li>O primeiro passo &eacute; fazer seu cadastro no Portal, <a href=\"https://www.portal.acretinos.com.br/cadastro\">clicando aqui</a>;</li>\r\n	<li>Com o cadastro feito, autentique-se com seu e-mail e senha cadastrados;</li>\r\n	<li>Com a tela inicial do portal aberta, no canto esquerdo &eacute; poss&iacute;vel ver um menu (Para smartphone &eacute; necess&aacute;rio expandir o menu, clicando no bot&atilde;o com 3 linhas horizontais no canto superior direito da tela);</li>\r\n	<li>No menu, clique em &#39;meus times&#39;. Por ser primeiro contato, voc&ecirc; n&atilde;o ter&aacute; times adicionados. Vamos resolver isso clicando em &#39;Novo time&#39;;</li>\r\n	<li>Na caixa de pesquisa, digite o nome do seu time ou do cartoleiro (como est&aacute; no cartola), e pe&ccedil;a para pesquisar (&eacute; fundamental que seu time esteja ativo no cartola);</li>\r\n	<li>Confira o seu time na lista a clique no &iacute;cone de &#39;check&#39;. Confirme a caixa de confirma&ccedil;&atilde;o e pronto, agora voc&ecirc; tem um time registrado na sua conta;</li>\r\n	<li>No meu lateral clique em &#39;Ligas&#39;;</li>\r\n	<li>Se clicar no card &#39;Bol&atilde;o tiro curto&#39;, na aba de categorias, ir&aacute; abrir uma tela com mais op&ccedil;&otilde;es de rodadas do Bol&atilde;o Acretinos. Um pouco abaixo dessa aba ter&atilde;o as 3 pr&oacute;ximas rodadas do bol&atilde;o. Escolha a que voc&ecirc; quer inscrever seu time;</li>\r\n	<li>Na p&aacute;gina que ir&aacute; se abrir, temos informa&ccedil;&otilde;es sobre o Bol&atilde;o Acretinos, insclusive com uma pr&eacute;via da premia&ccedil;&atilde;o com base nos times inscritos at&eacute; o momento. Selecione os times que quer inscrever e clique em &#39;Inscrever agora&#39; ou em &#39;Adicionar ao carrinho&#39;, caso queira se inscrever em mais rodadas;</li>\r\n	<li>Voc&ecirc; poder&aacute; ver o valor total do seu pedido de inscri&ccedil;&atilde;o no card &#39;Seu carrinho&#39;. Escolha uma das 8 op&ccedil;&otilde;es de bancos que temos dispon&iacute;veis;</li>\r\n	<li>Escolha a conta para transfer&ecirc;ncia. Importante nesta parte &eacute; transferir o valor para a conta escolhida e&nbsp;<strong>salvar o comprovante no celular ou computador</strong>;</li>\r\n	<li>Anexe o comprovante de transferencia e clique em &#39;Finalizar&#39;;</li>\r\n	<li>Pronto! Aguarde que sua inscri&ccedil;&atilde;o ser&aacute; confirmada pelos administradores;</li>\r\n</ol>\r\n\r\n<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/bolaoretornobody2.png\" style=\"height:420px; width:740px\" /></p>\r\n\r\n<p>Pelo card da tela inicial &eacute; poss&iacute;vel entrar na p&aacute;gina de vis&atilde;o geral para as rodadas do Bol&atilde;o Acretinos, onde &eacute; poss&iacute;vel pesquisar se seu time est&aacute; inscrito na rodada. Outra forma de fazer essa pesquisa &eacute; pelo site da liga na <a href=\"https://www.acretinos.com.br/bolao\">p&aacute;gina do bol&atilde;o</a>.</p>\r\n\r\n<p>Qualquer d&uacute;vida no momento da inscri&ccedil;&atilde;o pode ser tirada com os administradores da Liga Acretinos.</p>\r\n\r\n<p>Vamos mitar!</p>\r\n', 5, 1, '3cbd028df55bc8fe44196d985fcce438.png', 'ee61b72f6e9498ef08fd6ccdb3d6af5d.png', '2020-07-28 03:00:00', 'inscricoes-abertas-para-o-bolao-acretinos', 0, 0, 1),
(4, 'Melhor início da Liga Acretinos', 'Esta primeira rodada do brasileirão marcou o melhor início da Liga Acretinos na história, com o dobro de inscrições em relação à temporada passada.', '<p>O campeonato brasileiro est&aacute; de volta. Com ele&nbsp;nosso amado Cartola FC e consequentemente a&nbsp;<strong>LIGA ACRETINOS</strong>.</p>\r\n\r\n<p>A volta da Liga Acretinos para a temporada de 2020 certamente estar&aacute; na hist&oacute;ria da Liga. Isso porque a quantidade de times inscritos na Liga Cl&aacute;ssica e no Bol&atilde;o Acretinos dobraram nesta primeira rodada em rela&ccedil;&atilde;o &agrave; primeira rodada da temporada 2019.</p>\r\n\r\n<p>Apesar de existir desde 2014, a Liga Acretinos s&oacute; gahou tra&ccedil;os do que &eacute; atualmente na&nbsp;temporada de 2018. Naquela temporada&nbsp;42 times iniciaram a disputa da Liga Cl&aacute;ssica, que era a &uacute;nica competi&ccedil;&atilde;o organizada pela liga. Ao fim da temporada, tivemos testes de uma competi&ccedil;&atilde;o por rodada, que deu&nbsp;in&iacute;cio ao&nbsp;Bol&atilde;o Acretinos, mas ainda muito t&iacute;mida.</p>\r\n\r\n<p>Uma grande transforma&ccedil;&atilde;o se deu&nbsp;para a temporada de 2019: Liga Cl&aacute;ssica, Bol&atilde;o Acretinos e Mata-mata entrariam desde o in&iacute;cio como competi&ccedil;&otilde;es organizadas pela liga. Na Liga Cl&aacute;ssica, 104 times iniciaram a competi&ccedil;&atilde;o, representando um aumento de 147% em rela&ccedil;&atilde;o &agrave; 2018. 112 times foram inscritos na primeira rodada do Bol&atilde;o Acretinos.</p>\r\n\r\n<p>Durante a temporada de 2019 a liga teve um bom crescimento, com mais cartoleiros participando, com novas competi&ccedil;&otilde;es e com novidades como &aacute;rea de dados hist&oacute;ricos no site oficial da liga. O Bol&atilde;o Acretinos chegou a passar de 300 times inscritos em algumas rodadas.</p>\r\n\r\n<p>A COVID-19 veio como um balde de &aacute;gua fria em todos que de alguma forma participam do mundo do Cartola FC. A crise econ&ocirc;mica gerada pela pandemia dava o tom do que seria uma p&eacute;ssima temporada na Liga Acretinos. A realidade, por&eacute;m, foi totalmente contr&aacute;ria: Na Liga Cl&aacute;ssica, um aumento de 110% em rela&ccedil;&atilde;o &agrave; 2019, com 219 times inscritos; No Bol&atilde;o Acretinos, um crescimento percentual bem pr&oacute;ximo ao da Liga Cl&aacute;ssica, tendo 237 times inscritos para a primeira rodada, 111% a mais que a primeira rodada de 2019.</p>\r\n\r\n<p>Este in&iacute;cio &eacute; empolgante e mostra que a temporada ser&aacute; bastante dura para os cartoleiros. Crescer o n&uacute;mero de times faz tamb&eacute;m subir o j&aacute; alto n&iacute;vel dos cartoleiros da liga.</p>\r\n\r\n<p>A Liga Cl&aacute;ssica j&aacute; teve suas inscri&ccedil;&otilde;es encerradas, mas o Bol&atilde;o Acretinos est&aacute; com inscri&ccedil;&otilde;es abertas para todas as rodadas. Para se inscrever, acesse o <a href=\"https://portal.acretinos.com.br\">portal</a>. Em breve teremos abertura de inscri&ccedil;&otilde;es tamb&eacute;m para os mata-matas e competi&ccedil;&otilde;es por equipe.</p>\r\n\r\n<p>Em nome de todos os administradores da Liga Acretinos, fica a garantia de que ser&aacute; feito o m&aacute;ximo esfor&ccedil;o para que a temporada de 2020 supere as expectativas e possa ser a melhor de todas do in&iacute;cio ao fim. Esperamos que todos possam se divertir ao m&aacute;ximo, que sejam competitivos e, quem sabe, levem uma boa grana pra casa.&nbsp;</p>\r\n\r\n<p><strong>Boa sorte a todos e vamos MITAR!!</strong></p>\r\n', 6, 1, 'df5914dd3ca070ae98c1e9c0568078b1.png', '1421eba0a623961a0f1d0841d976d462.png', '2020-08-10 03:00:00', 'melhor-inicio-da-liga-acretinos', 0, 0, 1),
(5, 'igarapepreto10 é o vencedor da Rodada 01 do Bolão Acretinos em 2020', 'O time \'igarapepreto10\', do cartoleiro Jarbisson, foi o grande vencedor da primeira rodada do Bolão Acretinos 2020. Com 84.81 pontos ele conquistou o prêmio de R$ 1.039,50.', '<p>O time igarapepreto10,&nbsp;do cartoleiro Jarbisson, foi o vencedor do Bol&atilde;o Acretinos da Rodada 1 de 2020 ao fazer&nbsp;84.81 pontos na rodada. Com a vit&oacute;ria, Jarbisson coloca no bolso&nbsp;o pr&ecirc;mio de R$ 1.039,50,&nbsp;<a href=\"https://www.acretinos.com.br/noticias/noticia/melhor-inicio-da-liga-acretinos\">maior pr&ecirc;mio j&aacute; pago no Bol&atilde;o Acretinos em uma primeira rodada de campeonato</a>.</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/Cópia de CORPO.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>A rodada n&atilde;o foi das melhores para os cartoleiros, com muitos jogos sendo adiados, sendo que o jogo entre Goias e S&atilde;o Paulo foi adiado j&aacute; com o mercado do cartola fechado. Isso fez com que as op&ccedil;&otilde;es ficassem restritas e que alguns cartoleiros levassem desfalques logo na primeira rodada e consequentemente jogou a pontua&ccedil;&atilde;o geral para baixo. O time&nbsp;igarapepreto10 apostou na base do Gr&ecirc;mio, insclusive com Geromel de capit&atilde;o, para levar o pr&ecirc;mio m&aacute;ximo.</p>\r\n\r\n<p>Completaram o TOP 5 da primeira rodada do Bol&atilde;o Acretinos:&nbsp;mulek_doido&trade; (Mich Klopp),&nbsp;Real Madrid FC cezar (cezar),&nbsp;ganhei de novo (cristiano) e&nbsp;TiraOnda (Bet&atilde;o). A lista com os 20 melhores pontuadores da rodada voc&ecirc; pode conferir nos <a href=\"https://www.acretinos.com.br/historico/bolao/2020\">dados hist&oacute;ricos do bol&atilde;o</a>.</p>\r\n\r\n<p>As inscri&ccedil;&otilde;es para a Rodada 2 do Bol&atilde;o Acretinos se encerram &agrave;s 23h59 de 11 de agosto. N&atilde;o perca, inscreva-se no <a href=\"https://www.portal.acretinos.com.br/login\">Portal</a>.</p>\r\n', 5, 1, 'af25f24ba5fef91c1d48c48ed35d49b3.png', 'dcc75a2201e48e34c7ca98119e5b14d3.png', '2020-08-12 03:00:00', 'igarapepreto10-vencedor-da-rodada-01-do-bolao-acretinos-2020', 0, 0, 1),
(6, 'FORTINE FREE FIRE	é o vencedor da Rodada 02 do Bolão Acretinos', 'O time FORTINE FREE FIRE, do cartoleiro Jean, foi o mito da segunda rodada do Bolão Acretinos 2020. Com 99.01 pontos ele faturou o prêmio de R$ 958,50.', '<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/BAR02 CORPO.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>Com 99.01 pontos na rodada 2, o&nbsp;time FORTINE FREE FIRE, do cartoleiro Jean, foi o grande vencedor do Bol&atilde;o Acretinos. Com isso ele conquistou o pr&ecirc;mio de R$ 958,50.</p>\r\n\r\n<p>A rodada 2 novamente n&atilde;o foi da forma que todo cartoleiro gosta, mas j&aacute; tivemos um bom aumento na m&eacute;dia de pontua&ccedil;&atilde;o. Apesar de que muitas boas op&ccedil;&otilde;es para pontos foram preteridas em raz&atilde;o da busca por cartoletas, muitos dos jogadores mais baratos fizeram valer a confian&ccedil;a. O&nbsp;FORTINE FREE FIRE apostou quase que no time inteiro do Internacional, aproveitando das boas pontua&ccedil;&otilde;es de Saravia (17.30), Cuesta (8,90) e Guerrero (18.70), que era seu capit&atilde;o, para fazer 60% da pontua&ccedil;&atilde;o total do time.</p>\r\n\r\n<p>Completaram o TOP 5 da segunda rodada do Bol&atilde;o Acretinos:&nbsp;Kamikaze Pelado (Mayra Mota),&nbsp;DiNiZ Football (Marcelo Diniz),&nbsp;ganhei de novo (cristiano) e&nbsp;MESTRE-ITA-02 (junior ita). Destaque entre os premiados para o cartoleiro Cristiano, que ficou na quarta posi&ccedil;&atilde;o com seu time ganhei de novo, repetindo a posi&ccedil;&atilde;o da primeira rodada, e tamb&eacute;m para o cartoleiro Jarbisson que <a href=\"https://www.acretinos.com.br/noticias/noticia/igarapepreto10-vencedor-da-rodada-01-do-bolao-acretinos-2020\">venceu a primeira rodada</a> e desta vez conseguiu a 10&ordm; coloca&ccedil;&atilde;o.</p>\r\n\r\n<p>A lista com os 20 melhores pontuadores da rodada voc&ecirc; pode conferir nos <a href=\"https://www.acretinos.com.br/historico/bolaovariacao/2-2020\">dados hist&oacute;ricos do bol&atilde;o</a>.</p>\r\n\r\n<p>As inscri&ccedil;&otilde;es para a Rodada 3 do Bol&atilde;o Acretinos se encerram &agrave;s 23h59 de 14 de agosto. N&atilde;o perca, inscreva-se no <a href=\"https://www.portal.acretinos.com.br/login\">Portal</a>.</p>\r\n', 5, 1, '7f0e38f0dbc13f7329f20ddb638850d6.png', 'acb54f85e83f60cdb3225b3980849647.png', '2020-08-14 03:00:00', 'fortine-free-fire-vencedor-da-rodada-02-do-bolao-acretinos', 0, 0, 1),
(7, 'FLA CHEIRINHO FC é o vencedor da Rodada 03 do Bolão Acretinos', 'O time FLA CHEIRINHO FC, do cartoleiro Diones, foi o mito da terceira rodada do Bolão Acretinos 2020. Com 116.68 pontos ele faturou o prêmio de R$ 958,50.', '<p>Aparentemente o velho cartola voltou!</p>\r\n\r\n<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/BAR03 CORPO.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>Com 116.68 pontos na rodada 3, o&nbsp;time FLA CHEIRINHO FC, do cartoleiro Diones, foi o grande vencedor do Bol&atilde;o Acretinos. Com isso ele conquistou o pr&ecirc;mio de R$ 954,00.</p>\r\n\r\n<p>A rodada 3 veio diferente, do jeito que o cartoleiro gosta, com uma boa quantidade de gols e pontos, &eacute; claro. Para os cartoleiros que j&aacute; haviam conquistado um bom patrim&ocirc;nio nas primeiras duas rodadas, foi poss&iacute;vel arriscar mais e pontuar muito bem nessa rodada. Os destaques da rodada entre os jogadores foram Arrascaeta, com 18.7 pontos, e Marinho, que fez 23 pontos, ambos presentes no&nbsp;FLA CHEIRINHO FC, sendo Marinho o capit&atilde;o.</p>\r\n\r\n<p>Completaram o TOP 5 da terceira rodada do Bol&atilde;o Acretinos:&nbsp;duque de Caxias31 (luiz),&nbsp;Vem Devagar Vem Tranquilo (Breno/Rodrigo),&nbsp;Esteves C.F.C. (Matheus Esteves) e&nbsp;Boca united (Filipe santos).</p>\r\n\r\n<p>A lista com os 20 melhores pontuadores da rodada voc&ecirc; pode conferir nos <a href=\"https://www.acretinos.com.br/historico/bolaovariacao/3-2020\">dados hist&oacute;ricos do bol&atilde;o</a>.</p>\r\n\r\n<p>As inscri&ccedil;&otilde;es para a Rodada 4 do Bol&atilde;o Acretinos se encerram &agrave;s 23h59 de 18 de agosto. N&atilde;o perca, inscreva-se no <a href=\"https://www.portal.acretinos.com.br/login\">Portal</a>.</p>\r\n', 5, 1, '71ab6eff6864294186df8b3985aa2ca0.png', '92a7be087b304362b2fdd7fedc7c56bc.png', '2020-08-17 03:00:00', 'fla-cheirinho-fc-vencedor-da-rodada-03-do-bolao-acretinos', 0, 0, 1),
(8, 'GAME OVER F.C 10 é o campeão da Rodada 04 do Bolão Acretinos', 'O time GAME OVER F.C 10, do cartoleiro Clinton, foi o maior pontuador da rodada 04 do Bolão Acretinos 2020. Fazendo 104.60 pontos ele faturou o prêmio de R$ 1.030,50.', '<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/BAR04 CORPO.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>Com 104.60 pontos na rodada 4, o&nbsp;time GAME OVER F.C 10, do cartoleiro Clinton, foi o grande vencedor do Bol&atilde;o Acretinos. Com isso ele conquistou o pr&ecirc;mio de R$ 1.030,50.</p>\r\n\r\n<p>A rodada 4 foi um misto do que vimos nas 3 primeiras rodadas. Times muito favoritos perdendo SG, e mais uma vez o grande salvador da p&aacute;tria foi Marinho. Assim foi com o&nbsp;GAME OVER F.C 10, que apostou pesado no Santos e fez a diferen&ccedil;a na briga pelo Bol&atilde;o. Os destaques ficaram por conta de Marinho, capit&atilde;o do time, fazendo 13.9 pontos e com o goleiro do Santos,&nbsp;Jo&atilde;o Paulo, que conseguiu incr&iacute;veis 21.6 pontos.</p>\r\n\r\n<p>Completaram o TOP 5 da rodada 4 do Bol&atilde;o Acretinos:&nbsp;Flamengo Los Lobos (Daniel Fideles),&nbsp;MUCURAO FUTEBOL CLUB 6 (Rodrigo Andr&eacute;),&nbsp;Mais um Gole AC (Marcos Luz) e&nbsp;CENZALA E.C (Weliton gomes). Destaques n&atilde;o faltam entre os premiados: O primeiro destaque fica pelo campe&atilde;o,&nbsp;GAME OVER F.C 10, que j&aacute; havia sido premiado na rodada anterior; a franquia MUCURAO FUTEBOL CLUB com dupla premia&ccedil;&atilde;o tendo MUCURAO FUTEBOL CLUB 5 e&nbsp;MUCURAO FUTEBOL CLUB 6 entre os premiados; outro que cravou dois times no TOP 10 foi o cartoleiro Gustavo Freitas, com os times&nbsp;Real Salvador FC 94 e&nbsp;Boleiragem FC 94; por fim temos&nbsp;Joel Silva e Itamar, que haviam sido premiados na <a href=\"https://www.acretinos.com.br/historico/bolaovariacao/3-2020\">rodada 3</a> e voltaram a premiar na rodada 4, com o seus times 7B.E.C CORINTHIANS e&nbsp;MESTRE-ITA-05, respectivamente</p>\r\n\r\n<p>A lista com os 20 melhores pontuadores da rodada voc&ecirc; pode conferir nos <a href=\"https://www.acretinos.com.br/historico/bolaovariacao/4-2020\">dados hist&oacute;ricos do bol&atilde;o</a>.</p>\r\n\r\n<p>As inscri&ccedil;&otilde;es para a Rodada 5 do Bol&atilde;o Acretinos se encerram &agrave;s 23h59 de 21 de agosto. N&atilde;o perca, inscreva-se no <a href=\"https://www.portal.acretinos.com.br/login\">Portal</a>.</p>\r\n', 5, 1, '8a53192d0b216be1e981643696a00f1e.png', 'a02bd3e4c7ec05d5854f784f0c9b7120.png', '2020-08-21 03:00:00', 'game-over-f-c-10-campeao-rodada-04-bolao-acretinos', 0, 0, 1),
(9, 'David Banner é o vencedor da rodada 05 do Bolão Acretinos', 'O time David Banner, do cartoleiro Santana, foi o maior pontuador da rodada 05 do Bolão Acretinos 2020. Fazendo 89.28 pontos ele faturou o prêmio de R$ 976,50.', '<p><img alt=\"\" src=\"http://www.gerenciar.acretinos.com.br/assets/ckeditor/uploads/NCR05.png\" class=\"img-fluid\" /></p>\r\n\r\n<p>Fazendo 89.28 pontos na rodada 5, o&nbsp;time David Banner, do cartoleiro Santana, foi o grande campe&atilde;o do Bol&atilde;o Acretinos. Com isso ele embolsa o pr&ecirc;mio de R$ 976,50.</p>\r\n\r\n<p>A rodada 5 foi uma boa rodada, principalmente para quem teve que economizar cartoletas no goleiro, isso porque Fernando Pass que custava menos de C$1,00 acabou fazendo 16.20 pontos, para a alegria dos pobres. Para quem apostou no Bruno Henrique mantendo o t&iacute;tulo de rei dos cl&aacute;ssicos, n&atilde;o foi um jogo feliz, mas para quem apostou no Gabigol, em 1 minuto nos acr&eacute;scimos ele acertou uma bola na trave e marcou um gol de penalti, o que tamb&eacute;m contribuiu para boas pontua&ccedil;&otilde;es. Fernando Sobral e&nbsp;Thiago Galhardo, que eram &oacute;timas op&ccedil;&otilde;es para a rodada, vingaram e ajudaram muito nas boas pontua&ccedil;&otilde;es. Todos os citados estavam no time David Banner, que ainda contou com Alerrandro, que fez 8.3 pontos, e era o capit&atilde;o do time, somando ent&atilde;o 16.6.</p>\r\n\r\n<p>Completaram o TOP 5 da rodada 5 do Bol&atilde;o Acretinos:&nbsp;PASSOS FC AC (Wellisson Passos),&nbsp;Boca City F.C (Filipe Santos),&nbsp;METEORO ACRIANO (Zinedine) e&nbsp;RicRib013 (Ricardo Ribeiro).</p>\r\n\r\n<p>A lista com os 20 melhores pontuadores da rodada voc&ecirc; pode conferir nos <a href=\"https://www.acretinos.com.br/historico/bolaovariacao/5-2020\">dados hist&oacute;ricos do bol&atilde;o</a>.</p>\r\n\r\n<p>As inscri&ccedil;&otilde;es para a Rodada 6 do Bol&atilde;o Acretinos se encerram &agrave;s 23h59 desta sexta-feira, 28 de agosto. N&atilde;o perca, inscreva-se no <a href=\"https://www.portal.acretinos.com.br/login\">Portal</a>.</p>\r\n', 5, 1, '60dfdc64f9fc8b45180dfd818033b7a3.png', '5540c6aafcb3cc1dfdfdfc92a27e30d5.png', '2020-08-27 03:00:00', 'david-banner-vencedor-rodada-05-bolao-acretinos', 0, 0, 1);
